import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="hero-section">
        <h1>TELUGU BOX OFFICE</h1>
      </header>
      <main>
        <div className="image-container">
          <img src="./assets/tollywood.jpeg" alt="Telugu Box Office" />
        </div>
      </main>
    </div>
  );
}

export default App;
